<!doctype html>
                <meta charset="UTF-8">
                <title>Webpack Visualizer</title>
                <style>html {
    background-color: #f7eedf;
    color: #333;
}

body {
    font-family: sans-serif;
    margin: 10px auto 0;
    width: 750px;
    padding: 0 10px;
}

a,
.destyledButton {
    color: #347AB7;
}

p {
    margin-top: 0.5em;
}

svg {
    vertical-align: middle;
}

h1 {
    font-family: "Oswald", "HelveticaNeue-CondensedBold", "Arial Narrow", sans-serif;
    font-weight: bold;
    font-size: 70px;
    text-transform: uppercase;
    text-align: center;
}

hr {
    border: 0 none;
    border-top: 1px solid #aaa;
}

code {
    font-size: 16px;
}



.breadcrumbs {
    height: 1em;
    margin: 1em 0;
}

.uploadArea {
    position: relative;
    margin: 0 auto;
    min-height: 350px;
}
.uploadArea--needsUpload {
    border: 2px dashed #AC9062;
    border-radius: 10px;
    cursor: pointer;
}

.uploadArea--dragging {
    border-style: solid;
    background-color: #E6D4B6;
}

.uploadArea-uploadMessage {
    display: none;
    font-size: 1.9em;
    text-align: center;
    margin-top: 100px;
    pointer-events: none;
}
.uploadArea--needsUpload .uploadArea-uploadMessage {
    display: block;
}

.uploadArea-uploadMessage small {
    font-size: 0.5em;
}


.chart {
    position: relative;
    margin: 0 auto;
    min-height: 350px;
}
.chart--large {
    width: 950px;
    margin-left: -100px;
}



.hiddenFileInput {
    width: 0px;
    height: 0px;
    visibility: hidden;
}

.chart path {
    stroke: #fff;
}

.details {
    position: absolute;
    top: 325px;
    left: 50%;
    width: 170px;
    margin-left: -85px;
    font-size: 14px;
    text-align: center;
    color: #666;
    z-index: -1;
    overflow: hidden;
    text-overflow: ellipsis;
}

.chart--large .details {
    top: 425px;
}

.details-size {
    font-size: 0.9em;
    margin-top: 1em;
}

.details-name {
    font-weight: bold;
}

.details-subText {
    min-height: 1.2em;
}

.details-percentage {
    margin: 0.4em 0 0em;
    font-size: 2.4em;
    line-height: 1em;
}



.errorMessage {
    margin-top: 2em;
    padding: 0.8em 1em;
    border: 1px solid #ab2222;
    color: #ab2222;
}


footer {
    margin-top: 4em;
}

footer h2 {
    margin: 1.5em 0 0.5em;
    font-size: 1.3em;
}



.destyledButton {
    background: none;
    border: 0 none;
    cursor: pointer;
    font-size: inherit;
    padding: 0;
    text-decoration: underline;
}

\n    this.handleWindowResize();\n  },\n  watch: {\n    addressEntered(nextValue) {\n      this.handleWindowResize();\n    }\n  },\n  computed: {\n    // addressEntered() {\n    //   return this.$store.state.addressEntered;\n    // },\n    inputWidth() {\n      // if (this.addressAutocompleteEnabled) {\n        if (this.addressEntered === '' || this.addressEntered === null) {\n          return this.$props.widthFromConfig - 55;\n        } else {\n          return this.$props.widthFromConfig - 108;\n        }\n      // } else {\n      //   return this.$props.widthFromConfig - 55;\n      // }\n    },\n    inputClass() {\n      if (this.isMobileOrTablet) {\n        return 'pvc-input-mobile';\n      } else {\n        return 'pvc-input-non-mobile';\n      }\n    },\n    containerClass() {\n      if (this.isMobileOrTablet) {\n        return 'pvc-container-mobile';\n      } else {\n        return 'pvc-container-non-mobile';\n      }\n    },\n    buttonClass() {\n      if (this.isMobileOrTablet) {\n        return 'pvc-button-mobile'\n      } else {\n        return 'pvc-button-non-mobile'\n      }\n    },\n    addressAutocompleteEnabled() {\n      // TODO this is temporarily disabled\n      if (this.$config.addressInput) {\n        if (this.$config.addressInput.autocompleteEnabled === true) {\n          return true;\n        } else {\n          return false;\n        }\n      } else {\n        return false;\n      }\n    },\n    isMobileOrTablet() {\n      return this.$store.state.isMobileOrTablet;\n    },\n  },\n  methods: {\n    didType: debounce(function (e) {\n        // console.log('debounce is running');\n        const { value } = e.target;\n        this.$data.addressEntered = value;\n        // this.$store.commit('setAddressEntered', value);\n\n        if (this.addressAutocompleteEnabled) {\n          // console.log('debounce is running, e:', e, 'this:', this);\n          if (e.key === \"ArrowDown\") {\n            document.getElementById('address-candidate-list-0').focus();\n            return;\n          }\n          // const { value } = e.target;\n          this.getCandidates(value);\n          // this.$store.commit('setAddressEntered', value);\n          if (e.key !== \"Enter\") {\n            // console.log('AddressInput.vue didType is running, e.key !== \"Enter\"');\n            this.$store.commit('setShouldShowAddressCandidateList', true);\n          }\n        }\n      }, 300\n    ),\n    getCandidates(address) {\n      // console.log('getCandidates is running, address:', address);\n      axios.get('https://cqvfg1pm72.execute-api.us-east-1.amazonaws.com/dev/first-api-test/', {\n        params: {\n          address,\n        },\n      })\n        .then(this.didGetCandidates)\n        .catch(this.didGetCandidatesError);\n    },\n    didGetCandidates(res) {\n      const { matches } = res.data;\n      // console.log('matches:', matches, 'matches map:', matches.map(x => x.address));\n      const matchesArray = matches.map(x => x.address);\n      this.$store.commit('setCandidates', matchesArray);\n    },\n    didGetCandidatesError(err) {\n      console.log('error getting candidates', err);\n      this.$store.commit('setCandidates', []);\n    },\n    handleFormX() {\n      console.log('handleFormX is running');\n      this.$data.addressEntered = '';\n      // this.$store.commit('setAddressEntered', '');\n      this.$store.commit('setShouldShowAddressCandidateList', false);\n      this.$store.commit('setCandidates', []);\n    },\n    handleSearchFormSubmit() {\n      console.log('handleSearchFormSubmit is running');\n      let value;\n      if (this.addressAutocompleteEnabled){\n        value = addressEntered\n        // value = this.$store.state.addressEntered;\n      } else {\n        // if (document.querySelector('#' + inputID)) {\n        value = document.querySelector('#' + this.$data.inputID.toString()).value;\n        // } else if (document.querySelector('#pvm-search-control-input')) {\n        //   value = document.querySelector('#pvm-search-control-input')\n        // } else {\n        //   return;\n        // }\n      }\n      // console.log('phila-vue-comps AddressInput.vue, handleSearchFormSubmit is running, value:', value);\n      this.$controller.handleSearchFormSubmit(value);\n      // this.$store.commit('setAddressEntered', value);\n    },\n    handleWindowResize() {\n      const addressEntered = this.addressEntered;\n      // console.log('AddressInput.vue handleWindowResize is running', window.innerWidth, 'addressEntered:', addressEntered);\n      if (window.innerWidth >= 850) {\n        this.containerStyle.width = this.$props.widthFromConfig + 'px';\n        if (addressEntered === '' || addressEntered === null) {\n          this.inputStyle.width = this.$props.widthFromConfig - 55 + 'px';\n        } else {\n          this.inputStyle.width = this.$props.widthFromConfig - 108 + 'px';\n        }\n      } else if (window.innerWidth >= 750) {\n        this.containerStyle.width = this.$props.widthFromConfig - 100 + 'px';\n        if (addressEntered === '' || addressEntered === null) {\n          this.inputStyle.width = this.$props.widthFromConfig - 155 + 'px';\n        } else {\n          this.inputStyle.width = this.$props.widthFromConfig - 208 + 'px';\n        }\n      } else {\n        this.containerStyle.width = '300px';\n        if (addressEntered === '' || addressEntered === null) {\n          this.inputStyle.width = '245px';\n        } else {\n          this.inputStyle.width = '192px';\n        }\n      }\n    }\n  }\n};\n"},{"id":null,"identifier":"C:\\Users\\andy.rothwell\\TreeShake\\webpack_vue_6\\node_modules\\vue-loader\\lib\\loaders\\templateLoader.js??vue-loader-options!C:\\Users\\andy.rothwell\\TreeShake\\webpack_vue_6\\node_modules\\vue-loader\\lib\\index.js??vue-loader-options!C:\\Users\\andy.rothwell\\TreeShake\\webpack_vue_6\\node_modules\\rollup_vue_6\\src\\components\\Callout\\Callout.vue?vue&type=template&id=b878cbb0&scoped=true&","name":"./node_modules/vue-
